import React from 'react';
import './style.css';
function Header() {
  return (
    <div>
      <div className='logo'>
        <img
          src='https://themes.tielabs.com/wp-content/uploads/sites/3/2015/01/logo.png'
          alt='logo'
        />
      </div>
    </div>
  );
}

export default Header;
